svg.script:
var context;
if(window.AudioContext) {
  context = new AudioContext();
} else {
  context = new webkitAudioContext();
}

var oscillator;
var amplifier;

oscillator = context.createOscillator();
oscillator.frequency.value = 440;
amplifier = context.createGain();
amplifier.gain.value = 0;

oscillator.connect(amplifier);
amplifier.connect(context.destination);
oscillator.start(0);

function playSound(frequency) {
  var now = context.currentTime;
  oscillator.frequency.setValueAtTime(frequency, now);
  amplifier.gain.cancelScheduledValues(now);
  amplifier.gain.setValueAtTime(amplifier.gain.value, now);
  amplifier.gain.linearRampToValueAtTime(0.5, context.currentTime + 0.1);
}

function stopSound() {
  var now = context.currentTime;
  amplifier.gain.cancelScheduledValues(now);
  amplifier.gain.setValueAtTime(amplifier.gain.value, now);
  amplifier.gain.linearRampToValueAtTime(0.0, context.currentTime + 0.5);
}


