// Key event handlers

function keyDownHandler(e) {
  e.preventDefault();
  key = keys[e.keyCode];
  var el;
  if (key) {
    el = document.getElementById(key.key);
    if (key.key[1] === "s") {
      el.style.fill = "#2B2B2B";
      el.removeAttribute("filter");
      el.setAttribute("transform", "translate(0.000000, 1.000000)");
    } else {
      el.style.fill = "#cfcfcf";
      el.removeAttribute("filter");
      el.setAttribute("transform", "translate(0.000000, 1.000000)");
    }
    playSound(key.frequency);
  }
}

function keyUpHandler(e) {
  e.preventDefault();
  key = keys[e.keyCode];
  var el;
  if (key) {
    el = document.getElementById(key.key);
    if (key.key[1] === "s") {
      el.style.fill = "#565656";
      el.setAttribute("filter", "url(#blackKeyShadow)");
      el.setAttribute("transform", "translate(0.000000, 0.000000)");
    } else {
      el.style.fill = "#FAFAFA";
      el.setAttribute("filter", "url(#whiteKeyShadow)");
      el.setAttribute("transform", "translate(0.000000, 0.000000)");
    }
    stopSound();
  }
}

document.addEventListener('keydown', keyDownHandler);
document.addEventListener('keyup', keyUpHandler);

document.getElementById("miniMoog").addEventListener('focusin', function (){
  var light = document.getElementById("light");
  light.style.fill = "#CD3325";
});
document.getElementById("miniMoog").addEventListener('focusout', function (){
  var light = document.getElementById("light");
  light.style.fill = "#E66262";
});
